INSERT INTO `passages` VALUES (1,46,NULL,1,'sdasdasdasd',NULL),(2,46,1,1,'Der Atomkern ist der innerste, positiv geladene Teil eines Atoms. Die Unterteilung eines Atoms in Atomkern und Atomhülle geht auf Ernest Rutherford zurück, der 1911 in Streuexperimenten zeigte, dass Atome aus einem winzigen, kompakten Kern in einer leichten Hülle bestehen müssen. Dabei hat der Atomkern zwar einen 20.000 bis 150.000 Mal kleineren Durchmesser als die Atomhülle, beherbergt aber mehr als 99,9 Prozent der Masse des gesamten Atoms. Der Atomkern besteht aus Protonen und (außer bei 1H) Neutronen. Der Atomkern bestimmt durch seine Protonenzahl (auch Kernladungszahl, Ordnungszahl) die Anzahl der Elektronen eines elektrisch neutralen Atoms, dadurch auch die Struktur der Elektronenhülle und somit die chemischen Eigenschaften des Atoms. Protonen und Neutronen werden im Kern durch Kernkräfte zusammengehalten. Ändert sich der Aufbau oder Zustand eines Kerns, wie durch Radioaktivität, kann die umgesetzte Energie millionenfach größer sein als bei einer chemischen Reaktion der Hülle.\n\nDas Teilgebiet der Physik, das sich mit der Untersuchung und Beschreibung von Atomkernen beschäftigt, ist die Kernphysik. In Begriffen, die den Atomkern betreffen, wurde in der Anfangszeit meist der Vorsatz „Atom-“ verwendet. Später wurde das weitgehend abgelöst durch Kern- oder Nuklear-, nach dem lateinischen Wort nucleus für Kern. Nuklear bezeichnet Dinge oder Wirkungen, die mit Eigenschaften oder mit Kernreaktionen von Atomkernen zusammenhängen, beispielsweise Nuklearmedizin.\n\nDie einzelnen Atomsorten werden nach dem Aufbau ihrer Atomkerne als Nuklide bezeichnet.\n\nKenntnisse über die Eigenschaften von Atomkernen sind notwendig u. a. zum Verstehen der Radioaktivität, der Kernspaltung (Kernkraftwerk, Kernreaktor, Kernwaffe) und der Kernfusion (Kernfusionsreaktor, Wasserstoffbombe, Leuchten der Sterne), aber auch der Magnetresonanztomographie (MRT) in der Medizin sowie der Hyperfeinstruktur in der Spektroskopie.\n\nDer Atomkern im Atom\nDer Atomkern befindet sich im Zentrum des Atoms; sein Durchmesser beträgt etwa 1⁄20.000 bis 1⁄150.000 des Durchmessers der Elektronenhülle. Der Atomkern stellt aber, je nach Element, 99,95 bis 99,98 Prozent der Masse des gesamten Atoms.\n\nProtonen und Neutronen\nDer Kern ist aufgebaut aus Protonen und Neutronen, die zusammen auch Nukleonen genannt werden. Protonen sind elektrisch positiv geladen, sie tragen die Ladung \n+\ne\n{\\displaystyle +e}, wobei \ne\n{\\displaystyle e} die Elementarladung ist; Neutronen sind elektrisch neutral. Die Ladung eines Kerns mit \nZ\n{\\displaystyle Z} Protonen beträgt also \nZ\n⋅\ne\n{\\displaystyle Z\\cdot e}. Man bezeichnet \nZ\n{\\displaystyle Z} als Kernladungszahl.\n\nProtonen und Neutronen haben ungefähr dieselbe Masse. Die Masse eines Kerns mit \nZ\n{\\displaystyle Z} Protonen und \nN\n{\\displaystyle N} Neutronen ist daher ungefähr proportional zu \nA\n=\nZ\n+\nN\n{\\displaystyle A=Z+N}, der Zahl der Nukleonen. Man bezeichnet \nA\n{\\displaystyle A} als Massenzahl (für Genaueres zur Masse des Kerns siehe Kernmasse oder Massendefekt). Die Massenzahlen der auf der Erde natürlich vorkommenden Atome reichen von \nA\n=\n1\n{\\displaystyle A=1} (normaler Wasserstoff 1H) bis 244 (Plutonium 244Pu). Die makroskopische Dichte der kondensierten Materie dagegen steigt nicht proportional zur Atommasse, weil auch der Atomradius im Mittel um das 3–4-Fache ansteigt (neben starken periodischen Schwankungen, siehe Abb. in Atomradius).\n\nElemente und Isotope\nDa der Atomkern eine positive Ladung von \nZ\n⋅\ne\n{\\displaystyle Z\\cdot e} trägt, kann er durch die elektrostatische Anziehung negativ geladene Elektronen an sich binden. Die Ladungen von Elektron und Proton sind entgegengesetzt gleich, daher hat ein nach außen hin elektrisch neutrales Atom ebenso viele Elektronen in der Atomhülle wie Protonen im Kern. Da die Atomhülle weitestgehend die chemischen Eigenschaften bestimmt, legt die Kernladungszahl \nZ\n{\\displaystyle Z} damit auch fest, zu welchem Element das Atom gehört, sie ist die chemische Ordnungszahl.\n\nDie Zahl der Neutronen im Kern hingegen beeinflusst die chemischen Eigenschaften des Atoms fast überhaupt nicht. Unterscheidet man Kerne (oder ganze Atome) desselben Elements, also mit gleicher Protonenzahl, nach ihrer Anzahl von Neutronen, spricht man von den Isotopen des betreffenden Elements. Bezeichnet werden Nuklide mit dem chemischen Elementsymbol und der Massenzahl, wie das häufigste Kohlenstoffisotop 12C oder das häufigste Eisenisotop 56Fe. Weniger üblich ist die Schreibweise C-12 bzw. Fe-56, oder die redundante zusätzliche Angabe der Ordnungszahl: \n26\n56\nF\ne\n{\\displaystyle {}_{26}^{56}\\mathrm {Fe} }.\n\nNuklide\n\nNuklidkarte mit farblicher Kennzeichnung der Zerfallsarten\nDie Zahl der Neutronen hat nur geringen Einfluss auf die chemischen Eigenschaften des Atoms, ist aber entscheidend für die Stabilität oder Instabilität (Radioaktivität) des Kerns. Abgesehen vom radioaktiven Zerfall – der spontan eintritt – kann sich die Zahl der Protonen oder Neutronen im Kern nur durch eine Kernreaktion ändern, also infolge eines Zusammenstoßes des Kerns mit einem anderen Kern oder mit anderen Teilchen.\n\nEine durch Ordnungszahl und Massenzahl festgelegte Atom- oder Atomkernsorte wird Nuklid genannt. In manchen Fällen existieren langlebige Anregungsstufen des Kerns (siehe unten), die als Isomere bezeichnet werden und als eigene Nuklide zählen. Isomere werden mit dem Zusatz „m“ für „metastabil“ bezeichnet, z. B. 99mTc.[1] Es kann also zu einem Isotop eines Elements mehrere Nuklide geben, von denen dann höchstens eins stabil ist.\n\nEs sind (Stand von 2003) insgesamt etwa 3200 langlebige Nuklide bekannt,[2] die sich auf etwa 2700 Isotope[3] der 118 bekannten Elemente von Wasserstoff bis Oganesson verteilen. Darunter gibt es ca. 250 stabile Nuklide. Die Stabilität eines Nuklids hängt von der Zahl der Protonen und der Neutronen ab. Liegt das Verhältnis beider Zahlen außerhalb eines bestimmten Bereichs, ist der Kern instabil, d. h. radioaktiv, und wandelt sich in einen stabileren Kern um. Zu den Protonenzahlen 43, 61, oder größer als 82, gibt es gar kein stabiles Nuklid.\n\nDie Nuklide werden zur Übersicht in einer Nuklidkarte oder „Isotopenkarte“ durch kleine Quadrate grafisch dargestellt. Die Abbildung zeigt rund 1500 Nuklide. Die horizontale Achse gibt die Neutronenzahl an, die vertikale die Protonenzahl. Stabile Nuklide haben schwarze Quadrate, links unten beginnend mit 1H, rechts oben endend mit 208Pb. Die Schmalheit des schwarzen Bandes zeigt, wie genau die Abstimmung von Protonen- und Neutronenzahl für einen stabilen Kern sein muss. Bis A = 40 müssen beide Zahlen nahezu gleich sein, darüber müssen die Neutronen zunehmend im Überschuss vorhanden sein (bis ca. 1,6:1). Die übrigen Kerne sind sämtlich instabil, wobei die Farbe des Quadrats die radioaktiven Umwandlungsarten anzeigt. Generell sind Kerne mit gerader Protonen- und/oder Neutronenzahl eher stabil als solche mit ungeraden Zahlen; alle doppelt-ungeraden Kerne – mit Ausnahme von 2H, 6Li, 10B und 14N – sind instabil.',NULL),(3,46,1,2,'fsfsdfsdf',NULL),(4,46,1,3,'sdfsfdsdf',NULL);
